import React from "react";
import Banner from "../components/Banner";
import BannerA from "../assets/bannièreP.png";
import "../css/pages/layout.css";
import Collapse from "./Collapse";

function About() {
  return (
    <div>
      <div className="container">
        <Banner cover={BannerA} />
      </div>
      <div className="menu">
        <Collapse title="Fiabilité">
          <p>Le contenu concernant la fiabilité va ici.</p>
        </Collapse>
        <Collapse title="Respect">
          <p>Le contenu concernant le respect va ici.</p>
        </Collapse>
        <Collapse title="Service">
          <p>Le contenu concernant le service va ici.</p>
        </Collapse>
        <Collapse title="Sécurité">
          <p>Le contenu concernant la sécurité va ici.</p>
        </Collapse>
      </div>
    </div>
  );
}

export default About;
